import stileForm from './Form.module.css'

const stileI = stileForm.TitleSCard

const FormComponent = () => {
return(
<div className={`bg-danger ${stileI}`}>
<div className='container p-0 bg-primary'>
<div className='bg-success p-2'>
<div className='bg-secondary p-2'></div>
</div>  
</div>   
</div>
)};

export default FormComponent;
